import React from "react";

const DownloadOptions = ({ image }) => {
  if (!image) return null;

  return (
    <div>
      <a href={image} download="docfixer.jpeg">
        Download JPEG
      </a>
      <a href={image} download="docfixer.png">
        Download PNG
      </a>
    </div>
  );
};

export default DownloadOptions;
